// Configure historical import parameters
// Import all data from the beginning of Humanitix integration

const endDate = new Date();
const startDate = new Date('2024-01-01'); // Start from Jan 1, 2024

// Performance settings for bulk import
const bulkSettings = {
  batchSize: 100,
  rateLimitDelay: 500, // 0.5 seconds between API calls
  maxRetries: 5,
  concurrency: 10,
  pageSize: 100
};

// Data completeness requirements
const completenessRequirements = {
  events: {
    minFields: ['id', 'name', 'startDate', 'venue'],
    requiredData: ['ticketTypes', 'orders', 'customers']
  },
  orders: {
    minFields: ['id', 'eventId', 'total', 'status'],
    financialData: ['subtotal', 'fees', 'discounts', 'refunds']
  },
  customers: {
    minFields: ['email', 'firstName', 'lastName'],
    contactData: ['mobile', 'location']
  }
};

// Historical data validation
const validation = {
  enforceDataQuality: true,
  skipIncompleteRecords: false,
  logDataIssues: true,
  generateQualityReport: true
};

return [{
  json: {
    importConfig: {
      startDate: startDate.toISOString(),
      endDate: endDate.toISOString(),
      timeRange: `${startDate.toDateString()} to ${endDate.toDateString()}`,
      bulkSettings,
      completenessRequirements,
      validation
    },
    metadata: {
      importType: 'historical-complete',
      version: '2.0',
      timestamp: new Date().toISOString()
    }
  }
}];

// Handle pagination for complete event retrieval
const response = $json;
const allEvents = response.data || [];
const hasMore = response.pagination?.hasMore || false;
const currentPage = response.pagination?.currentPage || 1;
const totalPages = response.pagination?.totalPages || 1;

// If there are more pages, continue fetching
if (hasMore && currentPage < totalPages) {
  return [{
    json: {
      events: allEvents,
      pagination: {
        currentPage,
        totalPages,
        hasMore,
        nextPage: currentPage + 1
      },
      needsMorePages: true
    }
  }];
}

// All events retrieved
return [{
  json: {
    events: allEvents,
    pagination: {
      currentPage,
      totalPages,
      hasMore: false,
      complete: true
    },
    needsMorePages: false,
    totalEventsFound: allEvents.length
  }
}];

// Process complete event data with all related entities
const eventData = $node['Split Events for Processing'].json;
const ticketsResponse = $node['Fetch Event Tickets'].json;
const ordersResponse = $node['Fetch Event Orders'].json;

// Process event details
const event = {
  id: eventData.id,
  name: eventData.name,
  description: eventData.description,
  startDate: eventData.startDate,
  endDate: eventData.endDate,
  venue: {
    name: eventData.venue?.name || 'TBD',
    address: eventData.venue?.address || '',
    city: eventData.venue?.city || '',
    state: eventData.venue?.state || '',
    postalCode: eventData.venue?.postalCode || '',
    country: eventData.venue?.country || 'AU',
    capacity: eventData.venue?.capacity || 0
  },
  status: eventData.status,
  ticketsSold: eventData.ticketsSold || 0,
  grossRevenue: eventData.grossRevenue || 0,
  url: eventData.url,
  createdAt: eventData.createdAt,
  updatedAt: eventData.updatedAt
};

// Process ticket types with detailed information
const ticketTypes = (ticketsResponse.data || []).map(ticket => ({
  id: ticket.id,
  name: ticket.name,
  description: ticket.description,
  price: ticket.price || 0,
  quantityAvailable: ticket.quantityAvailable || 0,
  quantitySold: ticket.quantitySold || 0,
  status: ticket.status,
  saleStartDate: ticket.saleStartDate,
  saleEndDate: ticket.saleEndDate,
  isVisible: ticket.isVisible,
  sortOrder: ticket.sortOrder
}));

// Process orders with comprehensive financial data
const orders = (ordersResponse.data || []).map(order => {
  const subtotal = order.subtotal || 0;
  const fees = {
    humanitix: order.totals?.humanitixFee || 0,
    booking: order.totals?.bookingFee || 0,
    passedOn: order.totals?.passedOnFee || 0,
    absorbed: order.totals?.absorbedFee || 0,
    amex: order.totals?.amexFee || 0,
    zip: order.totals?.zipFee || 0,
    total: (order.totals?.humanitixFee || 0) + (order.totals?.bookingFee || 0) + (order.totals?.passedOnFee || 0) + (order.totals?.absorbedFee || 0) + (order.totals?.amexFee || 0) + (order.totals?.zipFee || 0)
  };

  const discounts = order.totals?.discounts || 0;
  const refunds = order.totals?.refunds || 0;
  const rebates = order.totals?.rebates || 0;
  const total = order.total || 0;

  // Calculate partner revenue share
  const partnerShare = subtotal - discounts - refunds - rebates - fees.passedOn;
  const humanitixShare = fees.humanitix + fees.booking + fees.absorbed;

  return {
    id: order.id,
    orderName: order.orderName,
    eventId: event.id,
    customer: {
      id: order.customerId,
      email: order.email,
      firstName: order.firstName,
      lastName: order.lastName,
      mobile: order.mobile,
      location: order.location || 'AU',
      businessPurpose: order.businessPurpose || false,
      international: order.international || false,
      organiserMailListOptIn: order.organiserMailListOptIn || false,
      additionalFields: order.additionalFields || []
    },
    tickets: (order.tickets || []).map(ticket => ({
      id: ticket.id,
      ticketTypeId: ticket.ticketTypeId,
      ticketTypeName: ticket.ticketType?.name || 'General',
      quantity: ticket.quantity || 1,
      price: ticket.price || 0,
      total: (ticket.price || 0) * (ticket.quantity || 1)
    })),
    financials: {
      subtotal,
      fees,
      discounts,
      refunds,
      rebates,
      total,
      partnerShare,
      humanitixShare
    },
    status: order.status,
    financialStatus: order.financialStatus,
    paymentGateway: order.paymentGateway,
    paymentMethod: order.paymentMethod,
    createdAt: order.createdAt,
    updatedAt: order.updatedAt,
    completedAt: order.completedAt,
    incompleteAt: order.incompleteAt
  };
});

// Extract and deduplicate customers
const uniqueCustomers = new Map();
orders.forEach(order => {
  const customer = order.customer;
  if (!uniqueCustomers.has(customer.email)) {
    uniqueCustomers.set(customer.email, {
      ...customer,
      orders: [{
        orderId: order.id,
        orderName: order.orderName,
        eventId: order.eventId,
        total: order.financials.total,
        partnerShare: order.financials.partnerShare,
        status: order.status,
        createdAt: order.createdAt
      }],
      totalSpent: order.financials.total,
      totalOrders: 1,
      firstOrderDate: order.createdAt,
      lastOrderDate: order.createdAt
    });
  } else {
    const existingCustomer = uniqueCustomers.get(customer.email);
    existingCustomer.orders.push({
      orderId: order.id,
      orderName: order.orderName,
      eventId: order.eventId,
      total: order.financials.total,
      partnerShare: order.financials.partnerShare,
      status: order.status,
      createdAt: order.createdAt
    });
    existingCustomer.totalSpent += order.financials.total;
    existingCustomer.totalOrders += 1;
    existingCustomer.lastOrderDate = order.createdAt;
  }
});

const customers = Array.from(uniqueCustomers.values());

// Calculate comprehensive event summary
const eventSummary = {
  totalOrders: orders.length,
  totalCustomers: customers.length,
  totalTicketsSold: orders.reduce((sum, order) => sum + order.tickets.reduce((ticketSum, ticket) => ticketSum + ticket.quantity, 0), 0),
  totalGrossSales: orders.reduce((sum, order) => sum + order.financials.total, 0),
  totalNetSales: orders.reduce((sum, order) => sum + order.financials.subtotal, 0),
  totalFees: orders.reduce((sum, order) => sum + order.financials.fees.total, 0),
  totalDiscounts: orders.reduce((sum, order) => sum + order.financials.discounts, 0),
  totalRefunds: orders.reduce((sum, order) => sum + order.financials.refunds, 0),
  totalRebates: orders.reduce((sum, order) => sum + order.financials.rebates, 0),
  partnerShare: orders.reduce((sum, order) => sum + order.financials.partnerShare, 0),
  humanitixShare: orders.reduce((sum, order) => sum + order.financials.humanitixShare, 0),
  averageOrderValue: orders.length > 0 ? orders.reduce((sum, order) => sum + order.financials.total, 0) / orders.length : 0,
  repeatCustomers: customers.filter(c => c.totalOrders > 1).length,
  repeatCustomerRate: customers.length > 0 ? customers.filter(c => c.totalOrders > 1).length / customers.length * 100 : 0
};

// Create complete event dataset
const completeEventData = {
  event,
  ticketTypes,
  orders,
  customers,
  summary: eventSummary,
  dataQuality: {
    eventCompleteness: 100,
    ticketTypesCount: ticketTypes.length,
    ordersCount: orders.length,
    customersCount: customers.length,
    hasCompleteFinancialData: orders.every(o => o.financials.subtotal !== undefined)
  },
  processedAt: new Date().toISOString()
};

return [{ json: completeEventData }];

// Create comprehensive historical data summary
const allEventData = $input.all();
const totalEvents = allEventData.length;

// Aggregate all data
const aggregatedData = {
  importSummary: {
    totalEvents,
    totalOrders: allEventData.reduce((sum, event) => sum + event.json.summary.totalOrders, 0),
    totalCustomers: allEventData.reduce((sum, event) => sum + event.json.summary.totalCustomers, 0),
    totalTicketsSold: allEventData.reduce((sum, event) => sum + event.json.summary.totalTicketsSold, 0),
    totalRevenue: allEventData.reduce((sum, event) => sum + event.json.summary.totalGrossSales, 0),
    totalPartnerShare: allEventData.reduce((sum, event) => sum + event.json.summary.partnerShare, 0),
    totalHumanitixShare: allEventData.reduce((sum, event) => sum + event.json.summary.humanitixShare, 0),
    totalFees: allEventData.reduce((sum, event) => sum + event.json.summary.totalFees, 0),
    totalDiscounts: allEventData.reduce((sum, event) => sum + event.json.summary.totalDiscounts, 0),
    totalRefunds: allEventData.reduce((sum, event) => sum + event.json.summary.totalRefunds, 0)
  },

  // Event performance ranking
  eventPerformance: allEventData.map(event => ({
    eventId: event.json.event.id,
    eventName: event.json.event.name,
    eventDate: event.json.event.startDate,
    venue: event.json.event.venue.name,
    totalRevenue: event.json.summary.totalGrossSales,
    partnerShare: event.json.summary.partnerShare,
    orderCount: event.json.summary.totalOrders,
    customerCount: event.json.summary.totalCustomers,
    ticketsSold: event.json.summary.totalTicketsSold,
    averageOrderValue: event.json.summary.averageOrderValue,
    repeatCustomerRate: event.json.summary.repeatCustomerRate
  })).sort((a, b) => b.totalRevenue - a.totalRevenue),

  // Customer analytics
  customerAnalytics: {
    totalUniqueCustomers: allEventData.reduce((sum, event) => sum + event.json.summary.totalCustomers, 0),
    totalRepeatCustomers: allEventData.reduce((sum, event) => sum + event.json.summary.repeatCustomers, 0),
    overallRepeatRate: 0, // Will be calculated
    averageOrderValue: 0, // Will be calculated
    highValueCustomers: [] // Will be populated
  },

  // Financial breakdown
  financialBreakdown: {
    revenueByMonth: {},
    feeAnalysis: {
      totalFeesCollected: allEventData.reduce((sum, event) => sum + event.json.summary.totalFees, 0),
      averageFeePerOrder: 0,
      feePercentage: 0
    },
    discountAnalysis: {
      totalDiscountsGiven: allEventData.reduce((sum, event) => sum + event.json.summary.totalDiscounts, 0),
      discountPercentage: 0,
      averageDiscountPerOrder: 0
    }
  },

  // Data quality assessment
  dataQuality: {
    eventsWithCompleteData: allEventData.filter(event => event.json.dataQuality.hasCompleteFinancialData).length,
    dataCompletenessPercentage: 0,
    issuesFound: [],
    recommendationsForImprovement: []
  },

  // Complete datasets for partner invoicing
  partnerInvoicingData: allEventData.map(event => ({
    eventId: event.json.event.id,
    eventName: event.json.event.name,
    eventDate: event.json.event.startDate,
    venue: event.json.event.venue,
    summary: event.json.summary,
    orderBreakdown: event.json.orders.map(order => ({
      orderId: order.id,
      orderName: order.orderName,
      customer: {
        name: `${order.customer.firstName} ${order.customer.lastName}`,
        email: order.customer.email,
        mobile: order.customer.mobile
      },
      tickets: order.tickets,
      financials: order.financials,
      status: order.status,
      financialStatus: order.financialStatus,
      paymentGateway: order.paymentGateway,
      purchaseDate: order.createdAt,
      completedDate: order.completedAt
    })),
    customerMetrics: {
      totalCustomers: event.json.summary.totalCustomers,
      repeatCustomers: event.json.summary.repeatCustomers,
      repeatCustomerRate: event.json.summary.repeatCustomerRate
    }
  })),

  // Metadata
  metadata: {
    importType: 'historical-complete',
    importDate: new Date().toISOString(),
    dataSource: 'humanitix-api',
    version: '2.0',
    totalRecordsProcessed: allEventData.length
  }
};

// Calculate derived metrics
const totalOrders = aggregatedData.importSummary.totalOrders;
const totalRevenue = aggregatedData.importSummary.totalRevenue;

aggregatedData.customerAnalytics.overallRepeatRate = aggregatedData.customerAnalytics.totalRepeatCustomers / aggregatedData.customerAnalytics.totalUniqueCustomers * 100;
aggregatedData.customerAnalytics.averageOrderValue = totalRevenue / totalOrders;

aggregatedData.financialBreakdown.feeAnalysis.averageFeePerOrder = aggregatedData.importSummary.totalFees / totalOrders;
aggregatedData.financialBreakdown.feeAnalysis.feePercentage = aggregatedData.importSummary.totalFees / totalRevenue * 100;

aggregatedData.financialBreakdown.discountAnalysis.averageDiscountPerOrder = aggregatedData.importSummary.totalDiscounts / totalOrders;
aggregatedData.financialBreakdown.discountAnalysis.discountPercentage = aggregatedData.importSummary.totalDiscounts / totalRevenue * 100;

aggregatedData.dataQuality.dataCompletenessPercentage = aggregatedData.dataQuality.eventsWithCompleteData / totalEvents * 100;

return [{ json: aggregatedData }];

